-- ----------------------------
-- Table structure for el_exam
-- ----------------------------
DROP TABLE IF EXISTS `el_exam`;
CREATE TABLE `el_exam`  (
  `id` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT 'ID',
  `title` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '考试名称',
  `content` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL DEFAULT '' COMMENT '考试描述',
  `open_type` int NOT NULL DEFAULT 1 COMMENT '1公开2部门3定员',
  `join_type` int NOT NULL COMMENT '组题方式1题库,2指定',
  `level` int NOT NULL DEFAULT 0 COMMENT '难度:0不限,1普通,2较难',
  `state` int NOT NULL DEFAULT 0 COMMENT '考试状态',
  `time_limit` tinyint NOT NULL DEFAULT 0 COMMENT '是否限时',
  `start_time` datetime NULL DEFAULT NULL COMMENT '开始时间',
  `end_time` datetime NULL DEFAULT NULL COMMENT '结束时间',
  `create_time` datetime NULL DEFAULT NULL COMMENT '创建时间',
  `update_time` datetime NULL DEFAULT NULL COMMENT '更新时间',
  `total_score` int NOT NULL DEFAULT 0 COMMENT '总分数',
  `total_time` int NOT NULL DEFAULT 0 COMMENT '总时长（分钟）',
  `qualify_score` int NOT NULL DEFAULT 0 COMMENT '及格分数',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `open_type`(`open_type`) USING BTREE,
  INDEX `level`(`level`) USING BTREE,
  INDEX `join_type`(`join_type`) USING BTREE,
  INDEX `idx_exam_create_time`(`create_time`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_0900_ai_ci COMMENT = '课程' ROW_FORMAT = DYNAMIC;

