-- ----------------------------
-- View structure for v_user_dept_knowledge
-- ----------------------------
DROP VIEW IF EXISTS `v_user_dept_knowledge`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `v_user_dept_knowledge` AS select `k`.`knowledge_id` AS `knowledge_id`,`k`.`title` AS `title`,`k`.`content` AS `content`,`k`.`video_url` AS `video_url`,`k`.`attachment_url` AS `attachment_url`,`k`.`attachment_name` AS `attachment_name`,`k`.`knowledge_type` AS `knowledge_type`,`k`.`target_dept_ids` AS `target_dept_ids`,`k`.`status` AS `status`,`k`.`create_by` AS `create_by`,`k`.`create_time` AS `create_time`,`k`.`update_by` AS `update_by`,`k`.`update_time` AS `update_time`,`k`.`remark` AS `remark`,`u`.`dept_id` AS `user_dept_id` from (`kb_knowledge` `k` join `sys_user` `u`) where ((`k`.`status` = '0') and ((`k`.`target_dept_ids` is null) or (`k`.`target_dept_ids` = '') or (find_in_set(`u`.`dept_id`,`k`.`target_dept_ids`) > 0)));

-- ----------------------------
-- Triggers structure for table kb_study_record
-- ----------------------------
DROP TRIGGER IF EXISTS `tr_kb_study_record_update`;
delimiter ;;
CREATE TRIGGER `tr_kb_study_record_update` BEFORE UPDATE ON `kb_study_record` FOR EACH ROW BEGIN
    
    IF NEW.total_duration > 0 THEN
        SET NEW.progress = ROUND((NEW.study_duration / NEW.total_duration) * 100, 2);
    ELSE
        SET NEW.progress = 0.00;
    END IF;
    
    
    IF NEW.progress >= 100.00 THEN
        SET NEW.is_completed = 1;
        SET NEW.progress = 100.00;
    END IF;
    
    
    SET NEW.update_time = NOW();
END
;;
delimiter ;

