INSERT INTO `el_qu_answer` VALUES ('1989992474885668866', 'test_fill_001', 1, '', 'int、double、float、char、boolean、String', '这些关键字实际上是 Java 中的数据类型关键字，用于指定变量所存储的数据类型。当声明一个变量时，需要先指定其数据类型，再给出变量名，例如int age;中，int就是声明整数类型变量的关键字，它规定了变量age只能存储整数数据。不同的数据类型关键字对应不同的存储范围和数据形式，以满足各种编程需求。');
INSERT INTO `el_qu_answer` VALUES ('1989993934306328577', 'test_essay_001', 1, '', '封装、继承和多态\n封装：隐藏对象内部细节，仅通过公开接口交互，提高安全性和代码复用性。\n继承：子类继承父类属性和方法，减少代码冗余，实现代码扩展。\n多态：同一操作作用于不同对象产生不同结果，增强代码灵活性和可扩展性。', '封装通过访问控制（如 private、public）隐藏对象实现细节，只暴露必要接口，避免外部误操作，使代码更易维护。\n继承让子类复用父类代码，同时可添加新功能，体现 “is-a” 关系，简化代码结构。\n多态通过重写和接口实现，使不同对象对同一消息作出不同响应，降低代码耦合度，便于扩展新功能。');
