INSERT INTO `kb_knowledge` VALUES (6, '挖洞基本步骤', '# 一、挖洞基本步骤\n•111\n### 1.测现有功能点\n### 2.测路由\n### 3.测接口\n# 二、路由和接口\n路由(大多数情况)\n* 是名词\n* 响应为html\n接口(大多数情况)\n* 含动词\n* 响应是json\nurl含带 # ，在后面添加路由或接口访问才会有正确界面\n# 三、利用findsomething找到的数据\n### 分别当作路由或接口跑一遍\n* 路由：openurl插件\n* **接口**：burp找一个接口的包，根据请求行适当判断选取和修改  intruder爆破去跑\n页面刷新左下角会加载响应接口\n![image-20251102182323435](https://ss1.baidu.com/6ONXsjip0QIZ8tyhnq/it/u=423474926,1801248814&fm=179&app=35&f=PNG?w=518&h=136&s=ADFEEB16D210A1925C7BF2EA0300E03E)\n![Sunset.png](/profile/upload/2025/11/06/Sunset_20251106211628A001.png)', NULL, NULL, NULL, '1', 'article', NULL, '0', 'admin', '2025-11-02 18:21:09', 'admin', '2025-11-06 21:40:05', NULL);
